import React from 'react';
import bg13 from '../img/bg13.jpg';
import img7 from '../img/img7.jpg';
import bg from '../img/bg.jpg';
import img3 from '../img/img3.jpeg';
import bg7 from '../img/bg7.jpg'
import '../styles/acoes.css';
import testimg from "../img/testimg.jpg";
import { Card, Image  } from 'antd';
import 'antd/dist/antd.css';
import { createFromIconfontCN } from '@ant-design/icons';

const IconFont = createFromIconfontCN({
  scriptUrl: '//at.alicdn.com/t/font_8d5l8fzk5b87iudi.js',
});

export default function About() {
 return (
   <div className="fullpage" style={{ backgroundImage: `url(${bg})` }}>
     <div className="full2">
       <div className="txts">
         <h2>Atividades desenvolvidas !!</h2>
       </div>
       <div className="cp">
         <div className="bg" style={{ backgroundImage: `url(${bg7})` }}>
           <div className="self"><img src={require('../img/img7.jpg')} /></div>
           <h3>Wander Marques</h3>
           <h4>Instrutor de Informatica</h4>
           <p>Engenheiro de Software, atuo na area da tecnologia da informação no geral a 10 anos.</p>
           <div className="socialm">
             <ul className="sb">
               <li><IconFont type="icon-facebook" /></li>
               <li><IconFont type="icon-twitter" /></li>
               <li><IconFont type="icon-twitter" /></li>
             </ul>
           </div>
         </div>
       </div>
       <div className="inf0">
         <div className="target">Inclusão Digital</div>
         <div className="inf1">
           <h5>O Projeto Visão Social possui um laboratório de informática que é mantido por doações da comunidade, nele as crianças deselvolvem habilidades básicas que consideramos essenciais para a nossa geração. </h5>
         </div>
           <div className="fts">
           <Image width={100}src={require('../img/img3.jpeg')}/>
           <Image width={100}src={require('../img/img3.jpeg')}/>
           <Image width={100}src={require('../img/img3.jpeg')}/>
           <Image width={100}src={require('../img/img3.jpeg')}/>
           <Image width={100}src={require('../img/img3.jpeg')}/>
           <Image width={100}src={require('../img/img3.jpeg')}/>  
           <Image width={100}src={require('../img/img3.jpeg')}/>  
           <Image width={100}src={require('../img/img3.jpeg')}/>  
           <Image width={100}src={require('../img/img3.jpeg')}/>    
           </div>         
       </div>
       
       <div className="full3">
       <div className="target0">Aulas de Musica</div>

      </div>  
     </div>

   </div>
 );
}
